}
.ftp-remote-edit-view.ftp-remote-edit-resizer > .ftp-remote-edit-resize-handle {
  position: absolute;
  top: 0;
  bottom: 0;
  width: 4px;
  cursor: col-resize;
  z-index: 3;
}
.ftp-remote-edit-view.ftp-remote-edit-resizer[data-show-on-right-side='true'] > .ftp-remote-edit-resize-handle {
  left: -2px;
}
.ftp-remote-edit-view.ftp-remote-edit-resizer[data-show-on-right-side='false'] > .ftp-remote-edit-resize-handle {
  right: -2px;
}
.ftp-remote-edit-view .ftp-remote-edit-scroller {
  display: flex;
