  z-index: 1;
  margin-top: 0;
  margin-left: -10px;
  height: 2.5em;
  width: 2px;
  background: #568af2;
  opacity: 0;
  transition: opacity 0.16s;
}
.ftp-remote-edit-view .ftp-remote-edit-list:focus::before {
